import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Navigate } from 'react-router-dom';
import { Container, AppBar, Toolbar, Typography, Button } from '@mui/material';
import Dashboard from './Dashboard';
import BugList from './BugsList';
import Login from './forms/Login';
import Register from './forms/Register';
import Home from './Home';

const socket = new WebSocket('ws://localhost:8080');

function App() {
  const [bugs, setBugs] = useState([]);
  const [bugName, setBugName] = useState('');
  const [bugDescription, setBugDescription] = useState('');
  const [token, setToken] = useState(localStorage.getItem('token'));

  useEffect(() => {
    if (token) {
      socket.onmessage = (event) => {
        const data = JSON.parse(event.data);
        if (data.type === 'init' || data.type === 'update') {
          setBugs(data.bugs);
        }
      };
    }
  }, [token]);

  const handleAddBug = () => {
    socket.send(JSON.stringify({ type: 'addBug', name: bugName, description: bugDescription }));
    setBugName('');
    setBugDescription('');
  };

  const handleResolveBug = (id) => {
    socket.send(JSON.stringify({ type: 'resolveBug', id }));
  };

  const handleDeleteBug = (id) => {
    socket.send(JSON.stringify({ type: 'resolveBug', id }));
  };

  const handleEditBug = (bug) => {
    socket.send(JSON.stringify({ type: 'editBug', id: bug.id, name: bug.name, description: bug.description }));
  };

  const handleLogout = () => {
    setToken(null);
    localStorage.removeItem('token');
  };

  return (
    <Router>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" sx={{ flexGrow: 1 }}>
            Bug Tracker
          </Typography>
          <Link to="/" style={{ textDecoration: 'none', color: 'inherit' }}>
            <Button color="inherit">Home</Button>
          </Link>
          {token ? (
            <>
              <Link to="/dashboard" style={{ textDecoration: 'none', color: 'inherit' }}>
                <Button color="inherit">Add Bug</Button>
              </Link>
              <Link to="/bugs" style={{ textDecoration: 'none', color: 'inherit' }}>
                <Button color="inherit">All Bugs</Button>
              </Link>
              <Button color="inherit" onClick={handleLogout}>Logout</Button>
            </>
          ) : (
            <>
              <Link to="/login" style={{ textDecoration: 'none', color: 'inherit' }}>
                <Button color="inherit">Login</Button>
              </Link>
              <Link to="/register" style={{ textDecoration: 'none', color: 'inherit' }}>
                <Button color="inherit">Register</Button>
              </Link>
            </>
          )}
        </Toolbar>
      </AppBar>
      <Container component="main" sx={{ marginTop: 4, padding: 2 }}>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login setToken={(token) => { setToken(token); localStorage.setItem('token', token); }} />} />
          <Route path="/register" element={<Register setToken={(token) => { setToken(token); localStorage.setItem('token', token); }} />} />
          {token ? (
            <>
              <Route path="/dashboard" element={
                <Dashboard
                  bugs={bugs}
                  bugName={bugName}
                  setBugName={setBugName}
                  bugDescription={bugDescription}
                  setBugDescription={setBugDescription}
                  handleAddBug={handleAddBug}
                  handleResolveBug={handleResolveBug}
                />
              } />
              <Route path="/bugs" element={<BugList bugs={bugs} handleDeleteBug={handleDeleteBug} handleEditBug={handleEditBug} />} />
            </>
          ) : (
            <Route path="*" element={<Navigate to="/login" />} />
          )}
        </Routes>
      </Container>
    </Router>
  );
}

export default App;
